import { seenOnBway } from "./seenOnBway";

function listShows(props) {
    const shows = seenOnBway;
    const showList = props.map((shows) => {
        return (
            <li>
            Show # {shows.id}<br />
            Show Type: {shows.showType}<br />
            Theatre: {shows.theatre}<br />
            Date Seen: {shows.seenOn}<br />
            Rating out of 5 stars: {shows.stars}
            </li>
        );
    });
    return <ul>{showList}</ul>;
};
export default listShows;
